script: |
  super -f text -I q5798.spq | sort > q5798.out

inputs:
  - name: q5798.spq
    data: |
      SELECT + - 56 AS col2, - col1 + + - col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col2 - - 88 NOT IN ( + + 64 / CAST ( - col0 AS INTEGER ) + - 54 * + col1 * - 38, - col2 );
  - name: tab2

outputs:
  - name: q5798.out
    data: |
